// src/components/Team.jsx

import React from 'react';

const Team = ({ team }) => {
  return (
    <div>
      <h2>My Team</h2>
      <div style={{ display: 'flex', gap: '1rem' }}>
        {team.map(p => (
          <div key={p.id}>
            <img src={p.image} alt={p.name} width={50} />
            <div>{p.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Team;
